// import axios from 'axios';
import React from "react";

import { Link, NavLink } from "react-router-dom";
import { Button, GetPosts, UpdatePost } from "../conponents";
import "../scss/app.scss";
import '../scss/components/button.scss'

function Home() {

    const openMenu = () => {
        document.getElementById('menu').classList.toggle("show")  
        // let menu = document.getElementById('menu')
        // console.log(menu);
    }

  const deletToken = () => {
    localStorage.removeItem('token')
    console.log('good');
  }

  return (
    <div className="home">
      {localStorage.getItem('token') ? (
        <div className="for-autho-user">
          <div className="dataOfUser">
            <img src="data:image/jpeg;base64," alt="" />
            <p>Leonardo Dicaprio</p>
          </div>
          <div className="menu-block">
            <img src="https://img.icons8.com/ios-glyphs/30/ffffff/menu--v1.png" onClick={openMenu}/>
            <ul id="menu">
              <li><a>Cre<span>a</span>te</a></li>
              <li><a>Setti<span>n</span>gs</a></li>
              <li onClick={deletToken}><a >Log<span>o</span>ut</a></li>
            </ul>
          </div>
          <div className="content-header">
            <h1>
              Tell <span>me</span>
            </h1>
            <p>
              Welcome to home! <br />
              May be you want write post about new dream or little history...{" "}
              <br /> You may do it here:
            </p>
            <Link to="create">
              <Button className="button-home">Create</Button>
            </Link>
          </div>
        </div>
      ) : (
        <div className="home-header">
          <h1>
            Tell <span>me</span>
          </h1>
          <p>
            Hi! Here you may write posts about your life, your dreams and share
            your purpose!!! <br /> Also you may read it about other people...
            Have a nice tripe in our world!
          </p>
          <div>
            <Link to="login">
              <Button className="button-home">Login</Button>
            </Link>{" "}
            <span>or</span>{" "}
            <Link to="/signup">
              <Button className="button-home">Register</Button>
            </Link>
            {/* <Link to=''><span className='arrow'>&#709;</span></Link> */}
          </div>
        </div>
      )}
      <div className="home-content">
        // <GetPosts />
        {/* <NavLink to={'/login'}>Login</NavLink><br/>
            <NavLink to={'/signup'}>signup</NavLink> */}
      </div>
    </div>
  );
}

export default Home;
